import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Box, CircularProgress } from '@mui/material';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { Container } from '@mui/material';
import { ThemeProvider as CustomThemeProvider } from './context/ThemeContext';
import Navigation from './components/Navigation';

// Lazy load components for better performance
const Dashboard = React.lazy(() => import('./components/Dashboard'));
const PatientForm = React.lazy(() => import('./components/PatientForm'));
const PatientHistory = React.lazy(() => import('./components/PatientHistory'));

// Loading component for lazy loading
const Loading = () => (
  <Box 
    display="flex" 
    justifyContent="center" 
    alignItems="center" 
    minHeight="80vh"
  >
    <CircularProgress />
  </Box>
);

// Create a theme
const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
    background: {
      default: '#f5f5f5',
    },
  },
});

function App() {
  return (
    <CustomThemeProvider>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <Router>
          <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
            <Navigation />
            <Container maxWidth="xl" sx={{ mt: 3, mb: 4, flexGrow: 1 }}>
              <React.Suspense fallback={<Loading />}>
                <Routes>
                  <Route path="/" element={<Dashboard />} />
                  <Route path="/predict" element={<PatientForm />} />
                  <Route path="/history" element={<PatientHistory />} />
                  <Route path="*" element={<Navigate to="/" replace />} />
                </Routes>
              </React.Suspense>
            </Container>
          </Box>
        </Router>
      </ThemeProvider>
    </CustomThemeProvider>
  );
}

export default App;
